import React from 'react';
import {Button} from 'react-bootstrap';
function NewsCard(props) {
    return (
        <div className="Card">
            <img className="Image" src={props.urlToImage} alt="Avatar" width="100%"></img>
            <div className="container">
                <h5>{props.title}</h5>
                <Button onClick={props.url} variant="dark">Go To Post</Button>
            </div>
        </div>
    );
}

export default NewsCard;
